import React from "react";

export default function ViewCollection(props) {
  const task = props.task;

  return (
    <div className="ViewCollection">
      <div
        className="content"
        style={{
          textAlign: "left",
          maxWidth: "70rem",
          minWidth: "70rem",
          border: "1px solid red",
        }}
      >
        <div className="collection__bar">
          <div className="collection__back-btn">
            <ion-icon name="chevron-back-outline"></ion-icon>
          </div>
          <div className="collection__name">{task.cName}</div>
          <div className="collection__dots">
              
            <div className="collection__actions">
              <div className="collection__action">edit collection</div>
              <div className="collection__action">delete collection</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
